struct Tensor {
  float* values = nullptr;
  size_t size = 0;
  bool readOnly = false;
  std::optional<Vector<float>> container;
  Tensor() = default;
  Tensor(const float* values, size_t size) : values((float*)values), size(size), readOnly(true) {}

  static Tensor zeros(size_t size) {
    Tensor r;
    r.container.emplace(size);
    r.values = r.container->data();
    r.size = size;
    return r;
  }

  std::string str() const {
    std::string r;
    r += "[";
    for (size_t i = 0; i != size; ++i) {
      if (i != 0) {
        r += ", ";
      }
      r += fmt::sprintf("%.04f", values[i]);
    }
    r += "]";
    return r;
  }

  const float& operator[](size_t index) const {
    return values[index];
  }
  float& operator[](size_t index) {
    return values[index];
  }

  Tensor operator+(const Tensor& n) const {
    CHECK(size == n.size);
    Tensor r = zeros(size);
    for (size_t i = 0; i != size; ++i) {
      r[i] = values[i] + n[i];
    }
    return r;
  }
  Tensor relu() const {
    Tensor r = zeros(size);
    for (size_t i = 0; i != size; ++i) {
      r[i] = std::max(values[i], 0.0f);
    }
    return r;
  }
};

struct Embedding {
  size_t num = 0;
  size_t dim = 0;
  const float* weights;

  Embedding() = default;
  Embedding(size_t num, size_t dim, const float* weights) : num(num), dim(dim), weights(weights) {}
  template<typename Array>
  Embedding(size_t num, size_t dim, const Array& weights) : num(num), dim(dim), weights(weights.data()) {
    CHECK(weights.size() == num * dim);
  }

  Tensor operator()(size_t input) {
    CHECK(input < num);
    return Tensor(weights + dim * input, dim);
  }
};

struct Linear {
  size_t inputs = 0;
  size_t outputs = 0;
  const float* weights;

  Linear() = default;
  Linear(size_t inputs, size_t outputs, const float* weights) : inputs(inputs), outputs(outputs), weights(weights) {}
  template<typename Array>
  Linear(size_t inputs, size_t outputs, const Array& weights)
      : inputs(inputs), outputs(outputs), weights(weights.data()) {
    CHECK(weights.size() == inputs * outputs);
  }

  Tensor operator()(const Tensor& input) {
    CHECK(input.size == inputs);
    Tensor output = Tensor::zeros(outputs);
    for (size_t oi = 0; oi != outputs; ++oi) {
      float v = 0;
      for (size_t ii = 0; ii != inputs; ++ii) {
        v += input[ii] * weights[inputs * oi + ii];
      }
      output[oi] = v;
    }
    return output;
  }
};

