ModelOutput evalModel(size_t worldSize, size_t localRanks, size_t bytes) {

  Embedding nnodes_emb(nnodes_size, dim, nnodes_emb_weight);
  Embedding local_ranks_emb(local_ranks_size, dim, local_ranks_emb_weight);
  Embedding size_emb(size_size, dim, size_emb_weight);

  Linear lin1(64, 64, lin1_weight);
  Linear lin2(64, output_size, lin2_weight);

  CHECK(worldSize % localRanks == 0);
  size_t nnodes = worldSize / localRanks;

  size_t nnodes_index = (size_t)(std::log2((float)nnodes));
  size_t localRanks_index = (size_t)(std::log2((float)localRanks));
  size_t bytes_index = (size_t)(std::log2((float)bytes));

  log.info("input %d %d %d\n", nnodes_index, bytes_index, localRanks_index);

  CHECK(nnodes_index < nnodes_size);
  CHECK(localRanks_index < local_ranks_size);
  CHECK(bytes_index < size_size);

  Tensor x = (nnodes_emb(nnodes_index) + local_ranks_emb(localRanks_index) + size_emb(bytes_index)).relu();

  x = lin1(x).relu();
  x = lin2(x);

  log.info("output is %s\n", x.str());

  ModelOutput r;

  size_t index = 0;
  float maxval = -1000.0f;
  for (size_t i = 0; i != output_size; ++i) {
    float value = x[i];
    if (value > maxval) {
      maxval = value;
      index = i;
    }
  }

  r.numParallel = 1 << (index % 3);
  r.numChunks = 1 << ((index / 3) / 4);
  r.numDevices = 1 << (index / (3 * 4));

  r.numChunks *= r.numDevices;

  return r;
}

